import React from 'react';
import { Routes, Route, useNavigate } from 'react-router-dom';
import DataConsumerPanel from './data_consumer_panel';
import DataProviderPanel from './data_provider_panel';


const Home: React.FC = () => {
  const navigate = useNavigate();

  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <h1>ZKP Data Exchange Platform</h1>
      <button onClick={() => navigate('/consumer')} style={{ margin: '10px' }}>Data Consumer</button>
      <button onClick={() => navigate('/provider')} style={{ margin: '10px' }}>Data Provider</button>
    </div>
  );
};

const App: React.FC = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/consumer" element={<DataConsumerPanel />} />
      <Route path="/provider" element={<DataProviderPanel />} />
    </Routes>
  );
};

export default App;
